IF OBJECT_ID('tb_OrderValues') IS NOT NULL
   DROP TABLE tb_OrderValues;
GO

CREATE TABLE tb_OrderValues(
	orderid int,
	custid int,
	empid int,
	shipperid int,
	orderdate datetime,
	requireddate datetime,
	shippeddate datetime,
	qty int,
	val numeric(12, 2)
);

IF OBJECT_ID('tb_CustOrders') IS NOT NULL
   DROP TABLE tb_CustOrders;
GO


CREATE TABLE tb_CustOrders(
	custid int ,
	ordermonth datetime,
	qty int 
);

IF OBJECT_ID('tb_EmpOrders') IS NOT NULL
   DROP TABLE tb_EmpOrders;
GO

CREATE TABLE tb_EmpOrders(
	empid int,
	ordermonth datetime ,
	qty int ,
	val numeric(12, 2) ,
	numorders int 
);

